import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class app extends Component{
  render(){
    const todoList=[
      'React practice',
      'game time'
    ];
    return (
      <div className="App">
      <h2>Todo List</h2>
        { todoList.map(item => <p>{item} </p>)}
      </div>
    );
  }
}



export default App;
